import {Route,Routes,Link} from "react-router-dom";
import { BrowserRouter } from 'react-router-dom';
import './App.css';
import Decoration from './Composants/Decoration';
import Menu from './Composants/Menu';
import Inscription from './Composants/inscription';
import Identite from "./Composants/ToutesIdentites";


function ModalWindow(){
  return (
      <div className="modal-window">

            <div className="fermer">
                <p>x</p>
            </div>
            {/*<h1>Welcome</h1>
            <h3>To Our Application</h3> */}
            <h4>My Identity</h4> 
            <div className="cercle-modale">
            </div> 
            <a href="./Composants/ToutesIdentite"><button className="btn" >OUVRIR</button></a>   


      </div>
  )
}


function Container(){
  return (
      <section className="container">    
          <Menu/>
          <div className="container-formulaire">
              <Decoration/>
          </div>
      </section>
  )
} 

function Accueil1(){
    return(        
    <div className="super-container">
        <ModalWindow/>
        <Container/>
    </div>
    )
}

function App() {
  return (
    <div>
        <BrowserRouter>    
            <Routes>
                <Route index element={<Accueil1/>} />
                <Route path="insription" element={<Inscription/>} />
                <Route path="ToutesIdentites" element={<Identite/>} />


            </Routes>
        </BrowserRouter>

    </div>

    );
}
export default App;
